import React, { Component } from "react";
import Button from "react-bootstrap/Button";
import "../App.css";
export default class Card extends Component {
  state = {};
  componentDidMount = () => {};
  constructor(props) {
    super();
  }
  render() {
    return (
      <Button color="yellow" className="bb">
        {this.props.val}
      </Button>
    );
  }
}
